package com.xworkz.inheritance.external;

public class Felidae {
    public Felidae() {
        System.out.println("No-args constructor of Felidae");
    }

    public void breathing() {
        System.out.println("Felidae is breathing");
    }

    public void eating() {
        System.out.println("Felidae is eating");
    }

    public void sleeping() {
        System.out.println("Felidae is sleeping");
    }

    public void roaring() {
        System.out.println("Felidae is roaring");
    }

    public void hunting() {
        System.out.println("Felidae is hunting");
    }
}

